import Introduction from './components/Introduction';
import ServicePage from './pages/ServicePage';

function App() {
  return (
    <div className="App" b>
      <nav className="bg-blue-500 p-4 flex items-center">
        {/* Logo Section */}
        <div className="flex-shrink-0">
          <img src="src/assets/images/logo.png" alt="Logo" className="h-8 w-8 mr-4" />
        </div>

        {/* Navigation Links */}
        <ul className="flex justify-around w-full">
          <li><a href="#Introduction" className="text-white">Introduction</a></li>
          <li><a href="#ServiceCard" className="text-white">Services</a></li>
          <li><a href="#HighlightedProducts" className="text-white">Products</a></li>
          <li><a href="#ClientTestimonial" className="text-white">Testimonials</a></li>
          <li><a href="#Register" className="text-white">Register</a></li>
          <li><a href="#Login" className="text-white">Login</a></li>
        </ul>
      </nav>

      <section id="Introduction" className="p-4">
        <Introduction />
      </section>

      <section id="ServicePage" className="p-4">
        <ServicePage />
      </section>

      
      <section id="testimonials" className="p-4">
        {/* Your Testimonials Component */}
      </section>

      <section id="register" className="p-4">
        {/* Your Register Component */}
      </section>

      <section id="login" className="p-4">
        {/* Your Login Component */}
      </section>
    </div>
  );
}

export default App;
